import Hero from "../components/Hero";

function Home () {
    return(
        <>
        <Hero 
        className='hero'
        Image='.components/assets/un.jpg'
        title='Your Journey to Diplomacy starts here'
        text = 'Choose your own path to Peace'
        url = '/register'
        buttonClass = 'show'
        buttonText = 'Register'
        />
        
        </>
    )
}

export default Home;
